import React from 'react'
import Navigation from '../components/Navigation.js'
import Footer from '../components/Footer.js'

class About extends React.Component {
  render () {
    return (
        <div>
          <Navigation />
          <h1>About Page</h1>
          <Footer />
        </div>
    )
  }
}
export default About;
